import { Autocomplete, TextField } from "@mui/material"

const courses =['reactjs','expressjs','nodejs','html','css','javascript','mongodb']
function AutoComplete() {
  return (
    <>
    <Autocomplete
      sx={{width:'300'}}
      options={courses}
      renderInput={(params)=>{
        <TextField label='select a course'/>
      }}
    />
      
    </>
  )
}

export default AutoComplete
